    methods:{
        handleNavClick(title){
            switch(title){
                case('Todo List'):
                    this.$router.push('/')
                    break;
                case('Map'):
                    this.$router.push('/map')
                    break;
                case('Reston'):
                    this.handleReston();
                    break;
                case('Mike\'s House'):
                    this.handleMike()
                    break;
                case('My House'):
                    this.handleMyHouse();
                    break;
                case('Show Florida'):
                    this.handleFlorida();
                    break;
                case('Colorado Square'):
                    this.handleColorado();
                    break;
                default:
                    alert('dont know that one chief');
            }
        },
        recurseArr(newArr){
          newArr.forEach(item => {
            if(item.length == 2){ 
              return item.reverse()
            }
            else{
              this.recurseArr(item)
            }
          })
        },
        handleMike(){
            // {lat: 39.135652755862196, lng: -76.64625871421225}
            this.myMap.panTo({lon: -76.64625871421225, lat: 39.135652755862196});
            this.myMap.zoomIn(11, {animate: true})
        },
        handleMyHouse(){
            // LatLng {lat: 39.02720626044225, lng: -77.1525790916042}
            this.myMap.panTo({lon: -77.1525790916042, lat: 39.02720626044225});
            this.myMap.zoomIn(11, {animate: true})
        },
        handleReston(){
            // {lat: 38.95885734141066, lng: -77.35224982404915}
            this.myMap.panTo({lon: -77.35224982404915, lat: 38.95885734141066});
            this.myMap.zoomIn(11, {animate: true})
        },
        handleColorado(){
          // create a red polygon from an array of LatLng points
            var latlngs = [[37, -109.05],[41, -109.03],[41, -102.05],[37, -102.04]];
            var polygon = L.polygon(latlngs, {color: 'red'}).addTo(this.myMap);
            // zoom the map to the polygon
            this.myMap.fitBounds(polygon.getBounds());
        },
        handleFlorida(){
            //var myRenderer = this.myMap.svg({ padding: 0.5 });
            let cords = this.recurseArr(this.floridaPoly3)
            //this.floridaPoly
            var line = L.polygon( this.floridaPoly3, {color: 'red'}).addTo(this.myMap);
            //var circle = this.myMap.circle( center, { renderer: myRenderer } );
            this.myMap.fitBounds(line.getBounds())
        },


        beforeEnter: function (el) {
          el.style.opacity = 0
        },
        enter: function (el, done) {
          var vm = this
          Velocity(el,
            { opacity: 1 },
            {
              duration: this.fadeInDuration,
              complete: function () {
                done()
                if (!vm.stop) vm.show = false
              }
            }
          )
        },
        leave: function (el, done) {
          var vm = this
          Velocity(el,
            { opacity: 0 },
            {
              duration: this.fadeOutDuration,
              complete: function () {
                done()
                vm.show = true
              }
            }
          )
        }
    },
    computed:{
      title(){
        if(this.myMap){
          return "MAP"
        }
        else{
          return "Todo App"
        }
      }
    }
  }
